INSERT [Purposes] ([Id], [Name], [Description], [Status], [CreatedAt], [LastModifiedAt], [CreatedById], [LastModifiedById]) VALUES (N'd2d4e250-30f1-488e-8044-e34984a7e103', N'Phân tích hiệu quả và cải thiện chất lượng Dịch vụ', N'FPT Edu sử dụng thông tin cá nhân của Chủ thể dữ liệu để đo lường việc sử dụng, phân tích hiệu quả để cải thiện chất lượng và phát triển Dịch vụ.', 1, CAST(N'2025-03-21T10:07:58.4966667' AS DateTime2), CAST(N'2025-03-21T10:07:58.4966667' AS DateTime2), NULL, NULL)
